3.0.2
All new re-designed ultra-crisp 192 pixel XXX-HDPI icons!
New theme dashboard - ultra-fast icon loading, easy icon request, and more
Now supports Aviate Launcher, built-in auto-apply feature
New icon requests added, now over 2,000 custom icons!
Icon pack cleaned and optimized, removed some older icons, fixed missing icons.

